import React from 'react';
import Navbar from './components/Navbar';
import './App.css';
import {BrowserRouter as Router, Route} from 'react-router-dom';

function App() {
  return (
    <>
    <Router>      
      <Navbar />
        <Route path='/' exact />
    </Router>
    </>
  );
}

export default App;
